import React from "react";

function ListItems() {
  return (
    <div className="ListItems">
      <ul className="list-shapes">
        <li className="shape-container circle-s"></li>
        <li className="shape-container square-s"></li>
        <li className="shape-container oval-s"></li>
        <li className="shape-container rectangle-s"></li>
        <li className="shape-container trapezoid-s"></li>
        <li className="shape-container parallelogram"></li>
      </ul>
    </div>
  );
}

export default ListItems;
